import React from 'react';
import { Menu } from 'semantic-ui-react';
import { Link } from '../routes';


export default () => {
    return (
            <Menu style={{ marginTop: '5px ', marginLeft:'80px', marginRight:'80px', backgroundColor:'#424240'}}>

            <Link route="/">
                <a className="item" style={{color:'#ffffff'}}>Halal Logistic System</a>
            </Link>

            <Menu.Menu position="right">

                <Link route="/form/Record">
                    <a className="item" tyle={{color:'#ffffff', type:'solid'}}>Records</a>
                </Link>

            </Menu.Menu>          
            </Menu>

    );
};
